import{_ as e,c as t,o as r,ag as o}from"./chunks/framework.DPDPlp3K.js";const b=JSON.parse('{"title":"effect","description":"","frontmatter":{},"headers":[],"relativePath":"src/UnitNDT/effect.md","filePath":"src/UnitNDT/effect.md"}'),l={name:"src/UnitNDT/effect.md"};function i(n,a,d,s,h,p){return r(),t("div",null,a[0]||(a[0]=[o('<h1 id="effect" tabindex="-1">effect <a class="header-anchor" href="#effect" aria-label="Permalink to &quot;effect&quot;">​</a></h1><h2 id="life" tabindex="-1">life <a class="header-anchor" href="#life" aria-label="Permalink to &quot;life&quot;">​</a></h2><p>translation:效果存在时间 <br>type:float <br>example:effect:custom:doge <br>默认值为200。到时间效果消失。 设置得尽可能低以减少效果开销。</p><h2 id="liferandom" tabindex="-1">lifeRandom <a class="header-anchor" href="#liferandom" aria-label="Permalink to &quot;lifeRandom&quot;">​</a></h2><p>translation:效果存在时间随机值 <br>type:float <br>example:lifeRandom: 12 <br>效果存在时间的随机范围。</p><h2 id="alsoemiteffectsondeath" tabindex="-1">alsoEmitEffectsOnDeath <a class="header-anchor" href="#alsoemiteffectsondeath" aria-label="Permalink to &quot;alsoEmitEffectsOnDeath&quot;">​</a></h2><p>translation:死亡时创建效果 <br>type:effect(s) code name <br>example:alsoEmitEffectsOnDeath:shibadie <br>在生命耗尽的时候创造这些效果。</p><h2 id="alsoemiteffects" tabindex="-1">alsoEmitEffects <a class="header-anchor" href="#alsoemiteffects" aria-label="Permalink to &quot;alsoEmitEffects&quot;">​</a></h2><p>translation:也创造效果 <br>type:effect(s) code name <br>example:alsoEmitEffects:custom:doge2 <br>创建时创建更多效果，对于多效果很有用。 注意：创建的效果上的其他“ alsoEmitEffects”将被忽略，禁止套娃。</p><h2 id="ifspawnfailsemiteffects" tabindex="-1">ifSpawnFailsEmitEffects <a class="header-anchor" href="#ifspawnfailsemiteffects" aria-label="Permalink to &quot;ifSpawnFailsEmitEffects&quot;">​</a></h2><p>translation:如果失败则创建效果 <br>type:effect(s) code name <br>example:ifSpawnFailsEmitEffects:custom:doge3 <br>如果此效果的“spawnChance”失败，则产生这些效果。</p><h2 id="alsoplaysound" tabindex="-1">alsoPlaySound <a class="header-anchor" href="#alsoplaysound" aria-label="Permalink to &quot;alsoPlaySound&quot;">​</a></h2><p>translation:也播放音效 <br>type:file(s) <br>example:alsoPlaySound:ao.ogg <br>播放音效，填文件名或内置。</p><h2 id="createwhenoffscreen" tabindex="-1">createWhenOffscreen <a class="header-anchor" href="#createwhenoffscreen" aria-label="Permalink to &quot;createWhenOffscreen&quot;">​</a></h2><p>translation:可创建于画面之外 <br>type:boolean <br>example:createWhenOffscreen:true <br>允许在画面之外产生此效果，默认为false。</p><h2 id="createwhenzoomedout" tabindex="-1">createWhenZoomedOut <a class="header-anchor" href="#createwhenzoomedout" aria-label="Permalink to &quot;createWhenZoomedOut&quot;">​</a></h2><p>translation:缩小时可产生效果 <br>type:boolean <br>example:createWhenZoomedOut:true <br>允许缩小时产生此效果，默认值为true</p><h2 id="createwhenoverliquid" tabindex="-1">createWhenOverLiquid <a class="header-anchor" href="#createwhenoverliquid" aria-label="Permalink to &quot;createWhenOverLiquid&quot;">​</a></h2><p>translation:创建于液体上 <br>type:boolean <br>example:createWhenOverLiquid:true <br>允许在液体上方产生此效果，默认值为true</p><h2 id="createwhenoverland" tabindex="-1">createWhenOverLand <a class="header-anchor" href="#createwhenoverland" aria-label="Permalink to &quot;createWhenOverLand&quot;">​</a></h2><p>translation:创建于陆地上 <br>type:boolean <br>example:createWhenOverLand:true <br>允许在陆地上方产生此效果，默认值为true</p><h2 id="spawnchance" tabindex="-1">spawnChance <a class="header-anchor" href="#spawnchance" aria-label="Permalink to &quot;spawnChance&quot;">​</a></h2><p>translation:产生几率 <br>type:float <br>example:spawnChance:0.9 <br>默认值1.如果小于1，则效果随机被创建</p><h2 id="showinfog" tabindex="-1">showInFog <a class="header-anchor" href="#showinfog" aria-label="Permalink to &quot;showInFog&quot;">​</a></h2><p>translation:在雾中显示 <br>type:boolean <br>example:showInFog:true <br>默认为false</p><h2 id="delayedstarttimer" tabindex="-1">delayedStartTimer <a class="header-anchor" href="#delayedstarttimer" aria-label="Permalink to &quot;delayedStartTimer&quot;">​</a></h2><p>translation:延迟创建 <br>type:float <br>example:delayedStartTimer:10 <br>等待这么久再播放此动画，单位为帧。</p><h2 id="delayedstarttimerrandom" tabindex="-1">delayedStartTimerRandom <a class="header-anchor" href="#delayedstarttimerrandom" aria-label="Permalink to &quot;delayedStartTimerRandom&quot;">​</a></h2><p>translation:延迟创建随机时间 <br>type:float <br>example:delayedStartTimerRandom:10 <br>等待时间随机变化</p><h2 id="liveafterattacheddies" tabindex="-1">liveAfterAttachedDies <a class="header-anchor" href="#liveafterattacheddies" aria-label="Permalink to &quot;liveAfterAttachedDies&quot;">​</a></h2><p>translation:目标死后存活 <br>type:boolean <br>example:liveAfterAttachedDies:true <br>目标死后动画继续存活,使用AttachedToUnit时默认为false.</p><h2 id="priority" tabindex="-1">priority <a class="header-anchor" href="#priority" aria-label="Permalink to &quot;priority&quot;">​</a></h2><p>translation:优先级 <br>type:enum <br>example:priority:low <br>默认为high，填不同的值对应不同的效果数量上限，并且通用。verylow/low/high/veryhigh/critical(很低，低，高，很高，至关重要)（上限分别是311，321，331，341，350）</p><h2 id="attachedtounit" tabindex="-1">attachedToUnit <a class="header-anchor" href="#attachedtounit" aria-label="Permalink to &quot;attachedToUnit&quot;">​</a></h2><p>translation:附着在单位上 <br>type:boolean <br>example:attachedToUnit:true <br>此效果产生时吸附到目标单位或抛射体。将与之一起移动。</p><h2 id="alwaystartdiratzero" tabindex="-1">alwayStartDirAtZero <a class="header-anchor" href="#alwaystartdiratzero" aria-label="Permalink to &quot;alwayStartDirAtZero&quot;">​</a></h2><p>translation:初始角度总是为零 <br>type:boolean <br>example:alwayStartDirAtZero:true <br>忽略附属单位或者产者的角度。</p><h2 id="atmospheric" tabindex="-1">atmospheric <a class="header-anchor" href="#atmospheric" aria-label="Permalink to &quot;atmospheric&quot;">​</a></h2><p>translation:空气效果 <br>type:boolean <br>example:atmospheric:true <br>添加阻力使此效果减慢速度，并添加随机移动。用于模拟尾焰。</p><h2 id="physics" tabindex="-1">physics <a class="header-anchor" href="#physics" aria-label="Permalink to &quot;physics&quot;">​</a></h2><p>translation:物理效果 <br>type:boolean <br>example:physics:true <br>撞击地面时反抛射体。需要高度才能生效。</p><h2 id="physicsgravity" tabindex="-1">physicsGravity <a class="header-anchor" href="#physicsgravity" aria-label="Permalink to &quot;physicsGravity&quot;">​</a></h2><p>translation:物理重力 <br>type:float <br>example:physicsGravity:1 <br>默认为1。physics:true时的垂直方向加速度。</p><h2 id="xoffsetrelative" tabindex="-1">xOffsetRelative <a class="header-anchor" href="#xoffsetrelative" aria-label="Permalink to &quot;xOffsetRelative&quot;">​</a></h2><p>translation:X相对偏移量 <br>type:float <br>example:xOffsetRelative:0 <br>效果起始时相对于炮塔，抛射体，单位的偏移的方向位置。正数向右，负数向左。</p><h2 id="yoffsetrelative" tabindex="-1">yOffsetRelative <a class="header-anchor" href="#yoffsetrelative" aria-label="Permalink to &quot;yOffsetRelative&quot;">​</a></h2><p>translation:Y相对偏移量 <br>type:float <br>example:yOffsetRelative:-25 <br>效果起始时相对于炮塔，抛射体，单位的偏移的方向位置。正数向前，负数向后。</p><h2 id="xoffsetrelativerandom" tabindex="-1">xOffsetRelativeRandom <a class="header-anchor" href="#xoffsetrelativerandom" aria-label="Permalink to &quot;xOffsetRelativeRandom&quot;">​</a></h2><p>translation:X相对随机偏移量 <br>type:float <br>example:xOffsetRelativeRandom:1 <br>X相对目标随机偏移量。随机增加或减少此值，用于偏移像素。</p><h2 id="yoffsetrelativerandom" tabindex="-1">yOffsetRelativeRandom <a class="header-anchor" href="#yoffsetrelativerandom" aria-label="Permalink to &quot;yOffsetRelativeRandom&quot;">​</a></h2><p>translation:Y相对随机偏移量 <br>type:float <br>example:yOffsetRelativeRandom:10 <br>Y相对目标随机偏移量。随机增加或减少此值，用于偏移像素。</p><h2 id="xoffsetabsolute" tabindex="-1">xOffsetAbsolute <a class="header-anchor" href="#xoffsetabsolute" aria-label="Permalink to &quot;xOffsetAbsolute&quot;">​</a></h2><p>translation:X绝对偏移量 <br>type:float <br>example:xOffsetAbsolute:0 <br>Absolute类为绝对偏移，它不像Relative那样考虑单位的方向。比如设置x向速度为1，绝对偏移则始终向右移动，相对偏移可以向任意方向移动。</p><h2 id="yoffsetabsolute" tabindex="-1">yOffsetAbsolute <a class="header-anchor" href="#yoffsetabsolute" aria-label="Permalink to &quot;yOffsetAbsolute&quot;">​</a></h2><p>translation:Y绝对偏移量 <br>type:float <br>example:yOffsetAbsolute:10 <br>按位置偏移起动效果，忽略附加炮塔单位等的方向。</p><h2 id="xoffsetabsoluterandom" tabindex="-1">xOffsetAbsoluteRandom <a class="header-anchor" href="#xoffsetabsoluterandom" aria-label="Permalink to &quot;xOffsetAbsoluteRandom&quot;">​</a></h2><p>translation:X绝对随机偏移量 <br>type:float <br>example:xOffsetAbsoluteRandom:2 <br>随机增加或减少此值，用于偏移像素。</p><h2 id="yoffsetabsoluterandom" tabindex="-1">yOffsetAbsoluteRandom <a class="header-anchor" href="#yoffsetabsoluterandom" aria-label="Permalink to &quot;yOffsetAbsoluteRandom&quot;">​</a></h2><p>translation:Y绝对随机偏移量 <br>type:float <br>example:yOffsetAbsoluteRandom:2 <br>随机增加或减少此值，用于偏移像素。</p><h2 id="xspeedrelative" tabindex="-1">xSpeedRelative <a class="header-anchor" href="#xspeedrelative" aria-label="Permalink to &quot;xSpeedRelative&quot;">​</a></h2><p>translation:X相对速度 <br>type:float <br>example:xSpeedRelative:1 <br>X轴相对于目标的移动速度。，正数向右，负数向左。</p><h2 id="yspeedrelative" tabindex="-1">ySpeedRelative <a class="header-anchor" href="#yspeedrelative" aria-label="Permalink to &quot;ySpeedRelative&quot;">​</a></h2><p>translation:Y相对速度 <br>type:float <br>example:ySpeedRelative:1 <br>Y轴相对于目标的移动速度。正数向前，负数向后。</p><h2 id="xspeedrelativerandom" tabindex="-1">xSpeedRelativeRandom <a class="header-anchor" href="#xspeedrelativerandom" aria-label="Permalink to &quot;xSpeedRelativeRandom&quot;">​</a></h2><p>translation:X随机相对速度 <br>type:float <br>example:xSpeedRelativeRandom:0.1 <br>随机增加或减少此值，用于偏移像素。</p><h2 id="yspeedrelativerandom" tabindex="-1">ySpeedRelativeRandom <a class="header-anchor" href="#yspeedrelativerandom" aria-label="Permalink to &quot;ySpeedRelativeRandom&quot;">​</a></h2><p>translation:Y随机相对速度 <br>type:float <br>example:ySpeedRelativeRandom:0.1 <br>随机增加或减少此值，用于偏移像素。</p><h2 id="xspeedabsolute" tabindex="-1">xSpeedAbsolute <a class="header-anchor" href="#xspeedabsolute" aria-label="Permalink to &quot;xSpeedAbsolute&quot;">​</a></h2><p>translation:X绝对速度 <br>type:float <br>example:xSpeedAbsolute:0.1 <br>X轴相对于起点的绝对移动速度。</p><h2 id="yspeedabsolute" tabindex="-1">ySpeedAbsolute <a class="header-anchor" href="#yspeedabsolute" aria-label="Permalink to &quot;ySpeedAbsolute&quot;">​</a></h2><p>translation:Y绝对速度 <br>type:float <br>example:ySpeedAbsolute:0.6 <br>Y轴相对于起点的绝对移动速度。</p><h2 id="xspeedabsoluterandom" tabindex="-1">xSpeedAbsoluteRandom <a class="header-anchor" href="#xspeedabsoluterandom" aria-label="Permalink to &quot;xSpeedAbsoluteRandom&quot;">​</a></h2><p>translation:X随机绝对速度 <br>type:float <br>example:xSpeedAbsoluteRandom:0.1 <br>按此值随机更改初始值。</p><h2 id="yspeedabsoluterandom" tabindex="-1">ySpeedAbsoluteRandom <a class="header-anchor" href="#yspeedabsoluterandom" aria-label="Permalink to &quot;ySpeedAbsoluteRandom&quot;">​</a></h2><p>translation:Y随机绝对速度 <br>type:float <br>example:ySpeedAbsoluteRandom:0.4 <br>按此值随机更改初始值。</p><h2 id="hoffset" tabindex="-1">hOffset <a class="header-anchor" href="#hoffset" aria-label="Permalink to &quot;hOffset&quot;">​</a></h2><p>translation:高度偏移 <br>type:float <br>example:hOffset:5 <br>距目标的高度偏移。正数向上，负数向下。</p><h2 id="hoffsetrandom" tabindex="-1">hOffsetRandom <a class="header-anchor" href="#hoffsetrandom" aria-label="Permalink to &quot;hOffsetRandom&quot;">​</a></h2><p>translation:随机高度偏移 <br>type:float <br>example:hOffsetRandom:3 <br>按此值随机更改初始值。</p><h2 id="hspeed" tabindex="-1">hSpeed <a class="header-anchor" href="#hspeed" aria-label="Permalink to &quot;hSpeed&quot;">​</a></h2><p>translation:高度速度 <br>type:float <br>example:hSpeed:1 <br>高度移动速度。正数向上，负数向下。</p><h2 id="hspeedrandom" tabindex="-1">hSpeedRandom <a class="header-anchor" href="#hspeedrandom" aria-label="Permalink to &quot;hSpeedRandom&quot;">​</a></h2><p>translation:随机高度速度偏移 <br>type:float <br>example:hSpeedRandom:0.1 <br>按此值随机更改初始值。</p><h2 id="diroffset" tabindex="-1">dirOffset <a class="header-anchor" href="#diroffset" aria-label="Permalink to &quot;dirOffset&quot;">​</a></h2><p>translation:角度偏移 <br>type:float <br>example:dirOffset:180 <br>角度偏移，修改初始朝向。注意,0度可能存在朝向问题。</p><h2 id="diroffsetrandom" tabindex="-1">dirOffsetRandom <a class="header-anchor" href="#diroffsetrandom" aria-label="Permalink to &quot;dirOffsetRandom&quot;">​</a></h2><p>translation:随机角度偏移量 <br>type:float <br>example:dirOffsetRandom:180 <br>按此值随机更改偏移角度。</p><h2 id="dirspeed" tabindex="-1">dirSpeed <a class="header-anchor" href="#dirspeed" aria-label="Permalink to &quot;dirSpeed&quot;">​</a></h2><p>translation:转速 <br>type:float <br>example:dirSpeed:5 <br>修改效果的旋转速度。</p><h2 id="dirspeedrandom" tabindex="-1">dirSpeedRandom <a class="header-anchor" href="#dirspeedrandom" aria-label="Permalink to &quot;dirSpeedRandom&quot;">​</a></h2><p>translation:随机转速 <br>type:float <br>example:dirSpeedRandom:2 <br>按此值随机更改旋转速度。</p><h2 id="pivotoffset" tabindex="-1">pivotOffset <a class="header-anchor" href="#pivotoffset" aria-label="Permalink to &quot;pivotOffset&quot;">​</a></h2><p>translation:枢轴偏移 <br>type:float <br>example:pivotOffset:1.2 <br>整个效果的朝向偏移</p><h2 id="pivotoffsetrandom" tabindex="-1">pivotOffsetRandom <a class="header-anchor" href="#pivotoffsetrandom" aria-label="Permalink to &quot;pivotOffsetRandom&quot;">​</a></h2><p>translation:枢轴偏移随机 <br>type:float <br>example:pivotOffsetRandom:1.2 <br>按此值随机更改朝向。</p><h2 id="frameindex" tabindex="-1">frameIndex <a class="header-anchor" href="#frameindex" aria-label="Permalink to &quot;frameIndex&quot;">​</a></h2><p>translation:帧索引 <br>type:integer <br>example:frameIndex:1 <br>使用内置效果时所取用的帧编号，0取第一帧。</p><h2 id="frameindexrandom" tabindex="-1">frameIndexRandom <a class="header-anchor" href="#frameindexrandom" aria-label="Permalink to &quot;frameIndexRandom&quot;">​</a></h2><p>translation:帧随机 <br>type:integer <br>example:frameIndexRandom:1 <br>随机增减索引值，用于随机使用同组内不同的图像。</p><h2 id="stripindex" tabindex="-1">stripIndex <a class="header-anchor" href="#stripindex" aria-label="Permalink to &quot;stripIndex&quot;">​</a></h2><p>translation:图像集 <br>type:integer/enum <br>example:stripIndex:shockwave <br>要使用的内置图像集。不能与自定义图像一起使用。如effects 效果1对应res内文件effects.png，以此类推。 explode_big爆炸效果图、light_50闪光贴花、flame开火图火焰、dust灰尘贴花、smoke_black黑烟、smoke_white白烟、shockwave冲击波、fire火焰图、lava_bubble岩浆泡、effects2效果2、plasma_shot等离子、shockwave2冲击波2、shockwave_large大冲击波、explode_bits碎片、explode_big2大爆炸、explode_bits_bug虫碎片、projectiles抛射体、projectiles2抛射体2、effects3效果3</p><h2 id="image" tabindex="-1">image <a class="header-anchor" href="#image" aria-label="Permalink to &quot;image&quot;">​</a></h2><p>translation:图像 <br>type:file <br>example:Image:shibaing.png <br>要使用的自定义图像文件。不能与stripIndex一起使用。</p><h2 id="imageshadow" tabindex="-1">imageShadow <a class="header-anchor" href="#imageshadow" aria-label="Permalink to &quot;imageShadow&quot;">​</a></h2><p>translation:阴影图像 <br>type:file <br>example:imageShadow:SHADOW:shibaing.png <br>用于自定义阴影的图像</p><h2 id="scaleto" tabindex="-1">scaleTo <a class="header-anchor" href="#scaleto" aria-label="Permalink to &quot;scaleTo&quot;">​</a></h2><p>translation:结束缩放倍数 <br>type:float <br>example:scaleTo:2 <br>效果结束时缩放倍数。</p><h2 id="scalefrom" tabindex="-1">scaleFrom <a class="header-anchor" href="#scalefrom" aria-label="Permalink to &quot;scaleFrom&quot;">​</a></h2><p>translation:初始缩放倍数 <br>type:float <br>example:scaleFrom:0.5 <br>效果初始时缩放倍数，用于效果从小到大缩放，或者反向缩放。</p><h2 id="color" tabindex="-1">color <a class="header-anchor" href="#color" aria-label="Permalink to &quot;color&quot;">​</a></h2><p>translation:颜色 <br>type:color <br>example:color:#FFFF0000 <br>填16进制颜色值，给图像上叠加颜色。一般建议图像使用灰度图，然后叠加颜色。注意彩色图是无法叠加白色变白的。</p><h2 id="teamcolorratio" tabindex="-1">teamColorRatio <a class="header-anchor" href="#teamcolorratio" aria-label="Permalink to &quot;teamColorRatio&quot;">​</a></h2><p>translation:队伍色相 <br>type:float <br>example:teamColorRatio:0.5 <br>填0-1在图像上叠加阵营色，1为完全为阵营色。</p><h2 id="drawtype" tabindex="-1">drawType <a class="header-anchor" href="#drawtype" aria-label="Permalink to &quot;drawType&quot;">​</a></h2><p>translation:绘制类型 <br>type:enum <br>example:drawType:displacement/normal <br>效果的绘制类型</p><h2 id="drawunderunits" tabindex="-1">drawUnderUnits <a class="header-anchor" href="#drawunderunits" aria-label="Permalink to &quot;drawUnderUnits&quot;">​</a></h2><p>translation:绘制在单位下方 <br>type:boolean <br>example:drawUnderUnits:true <br>将此效果绘制在单位下方。</p><h2 id="fadeintime" tabindex="-1">fadeInTime <a class="header-anchor" href="#fadeintime" aria-label="Permalink to &quot;fadeInTime&quot;">​</a></h2><p>translation:淡入时间 <br>type:float <br>example:fadeInTime:15 <br>设置淡入效果时间，从透明到不透明。透明度值从0%到100%。</p><h2 id="fadeout" tabindex="-1">fadeOut <a class="header-anchor" href="#fadeout" aria-label="Permalink to &quot;fadeOut&quot;">​</a></h2><p>translation:淡出 <br>type:boolean <br>example:fadeOut:true <br>设置淡入效果时间，透明度从100%淡出到%0。把alpha设置为高于1可以延长淡出。</p><h2 id="alpha" tabindex="-1">alpha <a class="header-anchor" href="#alpha" aria-label="Permalink to &quot;alpha&quot;">​</a></h2><p>translation:不透明度 <br>type:float <br>example:alpha:1 <br>介于0-1之间。可以设置为大于1以延迟淡出效果</p><h2 id="traileffect" tabindex="-1">trailEffect <a class="header-anchor" href="#traileffect" aria-label="Permalink to &quot;trailEffect&quot;">​</a></h2><p>translation:尾焰效果 <br>type:effect(s) code name <br>example:trailEffect:custom:trails <br>类似于抛射体的尾焰</p><h2 id="traileffectrate" tabindex="-1">trailEffectRate <a class="header-anchor" href="#traileffectrate" aria-label="Permalink to &quot;trailEffectRate&quot;">​</a></h2><p>translation:尾焰效果频率 <br>type:float <br>example:trailEffectRate:0 <br>产生频率</p><h2 id="shadow" tabindex="-1">shadow <a class="header-anchor" href="#shadow" aria-label="Permalink to &quot;shadow&quot;">​</a></h2><p>translation:阴影 <br>type:boolean <br>example:shadow:true <br>true时绘制阴影。如果使用imageShadow则强制为true</p><h2 id="frame-width" tabindex="-1">frame_width <a class="header-anchor" href="#frame-width" aria-label="Permalink to &quot;frame_width&quot;">​</a></h2><p>translation:单帧宽度 <br>type:integer <br>example:frame_width:1000 <br>规定单帧的宽度像素，如果值小于图像本体宽度则选取帧时采用换列方式进行处理。</p><h2 id="frame-height" tabindex="-1">frame_height <a class="header-anchor" href="#frame-height" aria-label="Permalink to &quot;frame_height&quot;">​</a></h2><p>translation:单帧高度 <br>type:integer <br>example:frame_height:1000 <br>规定单帧的高度像素，如果值小于图像本体高度则选取帧时采用换行方式进行处理。</p><h2 id="total-frames" tabindex="-1">total_frames <a class="header-anchor" href="#total-frames" aria-label="Permalink to &quot;total_frames&quot;">​</a></h2><p>translation:动画总帧数 <br>type:integer <br>example:total_frames:15 <br>动画的总帧数，与图像(image)或frameIndex一起使用。</p><h2 id="animateframestart" tabindex="-1">animateFrameStart <a class="header-anchor" href="#animateframestart" aria-label="Permalink to &quot;animateFrameStart&quot;">​</a></h2><p>translation:动画开始帧 <br>type:integer <br>example:animateFrameStart:0 <br>动画从哪一帧开始,第一帧编号为0</p><h2 id="animateframeend" tabindex="-1">animateFrameEnd <a class="header-anchor" href="#animateframeend" aria-label="Permalink to &quot;animateFrameEnd&quot;">​</a></h2><p>translation:动画结束帧 <br>type:integer <br>example:animateFrameEnd:14 <br>动画在哪一帧结束。</p><h2 id="animateframepingpong" tabindex="-1">animateFramePingPong <a class="header-anchor" href="#animateframepingpong" aria-label="Permalink to &quot;animateFramePingPong&quot;">​</a></h2><p>translation:动画帧重放 <br>type:boolean <br>example:animateFramePingPong:true <br>动画正序播放完毕后再倒序播放一次。</p><h2 id="animateframespeed" tabindex="-1">animateFrameSpeed <a class="header-anchor" href="#animateframespeed" aria-label="Permalink to &quot;animateFrameSpeed&quot;">​</a></h2><p>translation:动画帧速度 <br>type:time <br>example:animateFrameSpeed:0.2 <br>动画播放速度，单位位游戏帧，一般动画帧数也不高，所以设置一般为0.x</p><h2 id="animateframespeedrandom" tabindex="-1">animateFrameSpeedRandom <a class="header-anchor" href="#animateframespeedrandom" aria-label="Permalink to &quot;animateFrameSpeedRandom&quot;">​</a></h2><p>translation:动画帧随机速度 <br>type:time <br>example:animateFrameSpeedRandom0.1 <br>按此值随机更改动画速度。</p><h2 id="animateframelooping" tabindex="-1">animateFrameLooping <a class="header-anchor" href="#animateframelooping" aria-label="Permalink to &quot;animateFrameLooping&quot;">​</a></h2><p>translation:动画帧循环 <br>type:boolean <br>example:animateFrameLooping:false <br>默认false。当为false时,效果被移除时，动画结束</p><h2 id="animateframestartrandomadd" tabindex="-1">animateFrameStartRandomAdd <a class="header-anchor" href="#animateframestartrandomadd" aria-label="Permalink to &quot;animateFrameStartRandomAdd&quot;">​</a></h2><p>translation:动画开始帧随机偏移 <br>type:integer <br>example:animateFrameStartRandomAdd:10 <br>以动画起始帧为基准，按照+/-所填数字内随机选取数字进行帧随机偏移（似乎无用）</p>',149)]))}const m=e(l,[["render",i]]);export{b as __pageData,m as default};
